import uuid
import sha3

class Encryptor:
    def __init__(self,msg):
        self.msg = msg
        self.inverted_msg = self._invert(self.msg)
        self.uuid = self._getUUID()
        self.node = int(self._getPrimer()//self.uuid)

    def _invert(self,msg):
        return msg[::-1]

    def _getUUID(self):
        return uuid.uuid4().int

    def encrypt(self):
        encrypted_msg = []
        encrypted_msg.extend(ord(char) for char in self.inverted_msg)

        final_msg = ''

        for i in encrypted_msg:
            final_msg+=str((self.node//i))
            if len(encrypted_msg)>1:
                final_msg += '@'

        self.encrypted_msg = final_msg

    def _encryptSHA3(self,data):
        print(sha3.sha3_224(data.encode('utf-8')).hexdigest())

    def _getPrimer(self):
        return int()

class Decryptor:
    def __init__(self,msg,uuid):
        self.criptographed_msg = msg
        self.inverted_msg = ''
        self.decryptographed_msg = ''
        self.uuid = int(uuid)
        self.node = int(self._getPrimer() // self.uuid)

    def decrypt(self):
        decrypted_msg = []
        decrypted_msg = self.criptographed_msg.split('@')
        if len(decrypted_msg)>1:
            decrypted_msg.pop()
        # print(decrypted_msg)

        final_msg = []
        for x in decrypted_msg:
            final_msg.append(int(self.node//int(x)))
        # print(final_msg)

        self.inverted_msg=''.join(chr(i) for i in final_msg)
        # print(self.inverted_msg)
        self.decryptographed_msg = self._revert(self.inverted_msg)
        return self.decryptographed_msg

    def _revert(self,msg):
        return msg[::-1]

    def _getPrimer(self):
        return int()